() => {
      cy.visit(url);
      cy.intercept("POST", `${server_url}/todos`).as("postTodos");
      cy.get('[data-testid="todo-input"]').type("New Task");
      cy.get('[data-testid="add-button"]').click();
      cy.wait("@postTodos").then(() => {
        cy.get('[data-testid="todos-wrapper"]').children().should("have.length", 6);
        cy.get('[data-testid="todos-wrapper"]').children().eq(5).contains("New Task");
        cy.get('[data-testid="todos-wrapper"]').children().eq(5).contains("False");
      });
      cy.then(() => {
        acc_score += 3;
      });
    }

() => {
